import React from 'react';
import DailyChart from './DailyChart.js';
import IntradayChart from './IntradayChart.js';

function Chart({ gap, dailyData, intradayData }) {
  if (gap.type === 'daily') {
    return <DailyChart gap={gap} dailyData={dailyData} />;
  } else {
    return <IntradayChart gap={gap} intradayData={intradayData} />;
  }
}

export default Chart;
